import styleCss from "./components/style.module.css";
import { BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Signin from "./components/sign-in";
import { useNavigate } from 'react-router-dom'

function Ab() {

  const navigate = useNavigate()
  const handleClick = () => {
        navigate("/signin")
  }

  return (
      <div>
      
          <img onClick={handleClick} src="assets/RegisterBut"/>
        
      </div>
   
  );
}


(<Ab />);

function App() {


  return (
    <Router>
      <div className={styleCss.back}>
        <img src="assets/background.png" className={styleCss.latar} alt="Logo" />

        <img src="assets/icon.png" className={styleCss.icon} alt="Logo" />

        <div className={styleCss.content}>
          <p className={styleCss.text}>
            Sign-up now and subscribe to enjoy all the cool<br />
            and latest books - The best book rental service<br />
            provider in Indonesia
          </p>
          <button className={styleCss.signUp}>Sign Up</button>
          <button className={styleCss.signIn}><Ab /></button>
        </div>
      </div>
      { }
      <Routes>
        <Route exact path="/signin" element={<Signin />} />
      </Routes>
    </Router>
  );
}


export default App;
